import React from 'react';

export default class Login extends React.Component{
  state = {
    email: '',
    password: ''
  };

  handleSubmit = (event) => {
    event.preventDefault();
    console.log(this.state);
  };

  render() {
    return(
      <form onSubmit={this.handleSubmit}>
        <h1>Login to your account:</h1>
        <label>Email: </label>
        <input name="email" placeholder="freddie.mercury@gmail.com" size="35" value={this.state.email}/>
        <br/>
        <label>Password: </label>
        <input name="password" placeholder="queen_rox" size="35" value={this.state.password}/>
        <br/>
        <input type='submit'/>
      </form>
    )
  };
};
